import React, { Component } from 'react';
import { Parallax } from 'react-parallax';
class Agent extends Component {
  render() {
    return (
      <div className="Home">
        <Parallax bgImage={require('images/bg.jpg')} >
          <h1>WELCOME</h1>
          <h5>Contact {this.props.location.state.agent}</h5>
          <div class="row" >
            <form class="col s12">
              <div class="row">
                <div class="input-field col s12">
                  <input id="Email" type="email" class="validate" />
                  <label for="Email">Please Enter Email</label>
                </div>
              </div>
              <div class="row">
                <div class="input-field col s12">
                  <input id="Query" type="text" class="validate" />
                  <label for="Query">Please Enter your Query</label>
                </div>
                <div class="waves-effect waves-light btn">Submit</div>
              </div>
            </form>
          </div>
        </Parallax>
      </div>
    );
  }
}

export default Agent;
